import React from 'react';
import chatotchat from '../../assets/images/chatotchat.png';

const Home = (props) => {
  return (
    <div>
      <img src={chatotchat} height="100" width="100" />
      <span>Home Page</span>
    </div>
  );
};

export default Home;
